  `;return g.jsxs(g.Fragment,{children:[g.jsxs(e,{children:[g.jsx("h3",{children:"주소"}),g.jsx("p",{children:"도로명 주소: 경기도 수원시 팔달구 경수대로546 (인계동)"}),g.jsx("p",{children:"지번 주소: 경기도 수원시 팔달구 인계동 944-5"}),g.jsx("h3",{children:"버스 이용시"}),g.jsxs("p",{children:[g.jsx("span",{children:"KBS 수원센터 / 수원고용복지플러스센터, 동수원사거리"}),"정거장 하차"]})]}),g.jsx(Gj,{})]})}function tO(){let{id:e}=Ei();return e==0?g.jsx(Uj,{}):e==1?g.jsx(Bj,{}):e==2?g.jsx(Kj,{}):e==3?g.jsx(Zj,{}):e==4?g.jsx(eO,{}):g.jsx(Jj,{})}function nO(e){return g.jsx(So,{item:e.item,content:g.jsx(tO,{})})}const hv=[{title:"최고전문가에 의한 효과적인 예방법과 차별화된 비수술·최소침습시술로 모야모야 병기에 따른 최적 맞춤치료!",contents:["2011년, Ring Finger Protein (RNF213 p.R4810K) 유전자 변형이 모야모야병 환자에서 중요한 관계유전자라는 것이 밝혀졌습니다. 또 자가포식은 우리몸에서 불필요한 단백질을 제거하여 세포생존 및 활성 유지에 매우 중요한 생리기전이며, 굶주림 및 영양결핍과 저산소와 같은 심각한 세포 스트레스 조건에서 세포의 항상성을 유지합니다. 모야모야 환자에서의 뇌혈관악화가 당뇨병이나 갑상선기능항진증과 자주 병발되어 있다는 점을 착안하여 유전자 이상 유무에 따라 저산소 및 포도당결핍 스트레스에 반응하는 이 유전자가 불필요한 단백질이 세포에서 제거되는 과정에 중요한 기능을 한다고 알려져 있습니다. 연구책임자 홍지만 박사는 “희귀 난치성 모야모야 환자들에게 혈관내피세포의 기능회복과 자가포식 기전의 연관성을 보고하였다” 본 연구는 뇌혈류대사분야 국제적 권위 학술지인 ‘뇌혈류대사(JCBFM)지’의 2024년 4월 온라인판에 게재되었습니다.","모야모야병이나 동맥경화에 의한 심한 뇌관류저하에 대한 치료는 혈관을 직접 연결하여 혈류량을 늘리는 '직접 혈관 문합술' 과 혈관이 자라나서 보조적으로 혈류량을 늘리는 ‘간접 문합술’이 있습니다. 본 연구팀은 침습도가 가장 낮은 두개천공술을 이용했고, 모든 환자들은 편안한 진정이 가능한 국소마취를 시행하였습니다. 연구 결과, 6개월 뒤 신경학적 기능이 호전됐고 시술한 50부위 중 98%에서 혈관이 성공적으로 재생되었습니다. 시술 전후 중대한 합병증은 없었고, 환자 2명에서 일과성 허혈 증상이 있었으며, 1명에서 경미한 뇌경색 재발이 있었습니다. 이는 일반적인 혈관우회술 간접술의 합병증 발생률인 25%에 비해 병합 치료의 합병증 발생률을 1/3 이하로 줄였습니다. 또한 병합 약물은 과거 30년 이상 사용된 빈혈치료제로 조혈작용 외에도 뇌 보호작용과 혈관 재생에 기여한다는 점이 밝혀져 있어 안전하게 사용할 수 있었습니다. 본 연구는 세계 최고 권위 학술지인 ‘뇌졸중(Stroke)’지에 2018년과 2022년에 게재되었습니다."],clinics:["비교적 젊은 나이에 두개내 혈관이 좁은 경우, 유전자 양성 모야모야병 인지를 알아보는 것이 필요","두개내 혈관 협착과 유전자검사양성인 경우 주기적인 혈액검사와 뇌혈관-기능 검사가 필요","급성기 환자에서도 두개천공술과 빈혈치료제를 병합해 혈관 재생 유도 치료 위험도평가, 집중치료실, 최소침습시술, 2-3일간의 집중치료실, 3-5일간의 일반입원실 입원 후 퇴원"]},{title:"전문적팀으로 정확한 진단과 차별화된 집중치료 모니터링으로 고위험 환자에서도 최적 맞춤치료!",contents:["급성기 뇌졸중에서 '조기 신경학적 악화(Early Neurological Deterioration, END)'는 증상 발생 후 며칠 이내 신경학적 증상이 악화되는 합병증으로, 예후에 중요한 영향을 미칩니다. 집중치료실에서 이를 지속적으로 모니터링하며 치료할 수 있습니다. END 발생률은 연구에 따라 5~40%이며, NIHSS(미국립보건원 뇌졸중척도) 점수 증가로 평가됩니다. 주요 원인으로는 뇌부종, 재관류 손상, 출혈성 전환, 혈전 진행, 그리고 혈압·혈당 변동, 감염, 섬망, 경련 등의 전신적 요인이 있습니다. 특히 대혈관 폐색에 의한 뇌졸중이나 기저질환(당뇨, 심방세동, 고혈압 등)이 심한 경우 발생 위험이 높아 혈압·혈당 조절 및 즉각적인 신경영상 검사가 필요합니다.","뇌졸중 환자의 상당수가 삼킴곤란을 겪습니다. 입원 초기 삼킴 기능을 평가하며, 삼킴 장애가 있으면 음식물 종류를 제한하고 의료진이 삼킴법을 지도합니다. 충분한 영양 섭취가 어려운 경우 튜브를 통한 보조 영양이 필요하지만, 기능이 회복되면 제거할 수 있습니다.","뇌졸중 후 빠른 재활운동이 필수적입니다. 마비된 신체를 보호하는 자세 유지, 가래 배출을 돕는 물리치료 등이 포함됩니다. 재활은 기본적인 일상생활(옷 입기, 양치질)부터 사회활동(장보기, 대중교통 이용)까지 환자의 독립성을 회복하는 데 초점을 맞춥니다. 퇴원 후에도 심리적·사회적 지원을 통해 원활한 일상 복귀를 돕습니다."],clinics:["뇌의 불필요한 손상을 막기 위해 증상 발생 수 일간(약 72시간)은 집중치료실에서 절대안정","END 방지를 위해, 집중치료실에서 모니터링하며 의심시 침상옆에서 적절한 평가와 즉각정 치료","불안정한 시기가 지나면, 원인검사로 적절한 약물을 선택하고 재활을 통해 빠른 회복과 퇴원"]},{title:"최고의 전문가에 의한 효과적인 진단과 차별화된 치료시스템으로 개인화된 최적의 맞춤치료!",contents:["두통은 매우 흔한 증상으로, 기저질환 없이 발생하는 1차성 두통(편두통, 긴장성 두통, 군발두통)과 뇌졸중, 감염, 종양 등 기저질환으로 인해 생기는 2차성 두통으로 나뉩니다.편두통은 욱신거리는 통증과 함께 구역질, 빛·소리에 대한 민감성이 동반됩니다. 긴장성 두통은 양측의 압박감이 특징이며, 군발두통은 한쪽 눈 주위의 극심한 통증과 눈물·코막힘을 동반합니다.진단은 병력 청취 및 신경학적 검사로 시작하며, CT·MRI 등의 영상 검사가 필요할 수 있습니다. 편두통 치료에는 트립탄·NSAIDs(진통소염제)가 사용되며, 긴장성 두통은 진통제와 스트레스 관리가 중요합니다. 2차성 두통은 기저질환 치료가 우선됩니다.","어지럼증은 “말초성(내이 문제)과 중추성(뇌 질환)” 으로 구분됩니다. 말초성 어지럼증에는 이석증, 전정신경염, 메니에르병이 포함됩니다. 이석증은 특정 자세에서 짧고 강한 어지럼증을 유발하며, 전정신경염은 지속적인 회전성 어지럼증이 특징입니다. 메니에르병은 어지럼증, 이명, 청력 감소를 동반합니다. 중추성 어지럼증은 뇌졸중, 종양 등이 원인이며, 복시·보행 장애가 함께 나타날 경우 다양한 신경생리 검사가 필요합니다. 실신은 일시적인 뇌 혈류 감소로 인한 의식 소실로, 혈관미주신경성 실신, 기립성 저혈압, 심장성 실신으로 나뉩니다. 실신의 진단에는 심전도(EKG), 기립경사 검사 등이 활용되며, 원인에 따라 치료가 결정됩니다. 어지럼증의 치료는 원인에 따라 다릅니다. 이석증은 “Epley maneuver(체위치료)” 로 해결되며, 전정신경염은 스테로이드와 전정 재활 운동이 필요합니다. 메니에르병은 저염식, 이뇨제, 항히스타민제 등으로 관리됩니다. 중추성 어지럼증은 기저질환 치료가 우선됩니다. 예방을 위해서는 규칙적인 수면, 스트레스 관리, 유발 요인 회피가 중요하며, 전정 재활 운동이 도움이 될 수 있습니다."],clinics:["두통과 어지럼은 병력 청취와 신체검사가 매우 중요하며 이차성 두통을 확인하는 작업으로 영상검사나 난원공개존검사, 자율신경검사 등이 평가","어지럼증은 안구운동 검사, 자세 변화 관찰, 필요 시 MRI와 전정기능 등이 평가 실신은 심전도(EKG), 자율신경, 기립경사검사, 심장기능 검사 등이 평가"]},{title:"최고 전문의의 친절한 설명과 함께 차별화된 뇌졸중·치매를 통합하는 개인위험도에 따른 최적의 예방치료!",contents:["뇌졸중은 생명을 위협하는 질환으로, 예방과 조기 발견이 중요합니다. 뇌졸중 위험도 평가는 고혈압, 당뇨병, 고지혈증, 심혈관 질환, 흡연, 음주 습관 등을 분석하여 발생 가능성을 예측하는 과정입니다. 고혈압은 가장 중요한 위험 요인이므로 반복적인 혈압 측정과 관리가 필요합니다. 혈액 검사는 혈당, 지질 프로파일, 혈액 응고 능력 및 혈소판 응집 기능 등을 평가하며, “심전도(EKG)”는 심방세동 같은 부정맥을 진단하여 뇌졸중 위험을 조기에 파악합니다. 또한, 경동맥 초음파, CT, MRI 등을 통해 혈관 건강 상태를 확인할 수 있습니다. 다양한 혈관의 내막 기능과 중막의 경직도 기능 등을 측정할 수 있습니다. 생활습관 관리와 조기 진단을 통해 뇌졸중 발생 가능성을 줄일 수 있습니다.","혈관성 치매 예방에는 생활습관 개선과 기저질환 관리가 필수적입니다. 고혈압과 당뇨 조절, 건강한 식습관, 규칙적인 유산소 운동이 중요하며, 금연과 절주도 혈관 건강을 보호하는 데 필수적입니다. 당뇨 환자는 혈당 조절을 통해 미세혈관 손상을 방지해야 하며, 지질 조절로 동맥경화를 예방할 수 있습니다. 또한, “인지 자극 활동(독서, 퍼즐)”과 사회적 교류는 인지 기능 저하를 늦추는 데 도움이 됩니다.","노화 예방을 위해서는 항산화 식단, 유산소·근력 운동, 충분한 수면과 스트레스 관리가 필요합니다. 호르몬 대체 요법(HRT)과 항산화제(비타민 C, E), 오메가-3 섭취는 신체 노화를 늦추고 건강 수명을 연장하는 데 기여할 수 있습니다. 사회적 교류와 정서적 안정은 삶의 질 향상에도 중요한 역할을 합니다."],clinics:["뇌졸중 예방은 환자가 가지고 있는 개인의 뇌졸중 위험도 관리에 기반한 예방 전략","예방이 가능한 치매에 대해 정확한 진단과 올바른 치료전략으로 개인 맞춤으로 접근","노화는 피할 수 없지만 심-뇌혈관증강, 근력운동, 뇌-건강 증진법 등으로 건강수명 연장도모"]},{title:"자세, 체성분, 운동능력 분석으로 차별화된 운동치료로 최적의 맞춤치료!",contents:["교정된 신체는 원래 상태로 돌아가려는 경향이 있어, 이를 방지하기 위해 운동 치료가 필수적입니다. 홍지만신경과는 자세 분석, 체성분 및 보행 분석 등을 통해 환자의 상태를 정밀 평가하고, 맞춤형 운동 프로그램을 제공합니다. 특히 뇌졸중 환자 및 자세 변형으로 인한 통증 환자들에게 체계적인 교정과 운동 치료를 병행하여 증상을 완화하고 재발을 방지하는 데 중점을 둡니다.모션 캡처 시스템, 균형 측정 플랫폼, 보행 분석 시스템 등 첨단 기술을 활용하여 운동 능력을 평가하고, 시계열 분석을 통해 체계적이고 과학적인 치료를 제공합니다.","또한 급성기 치료 이후 재활 과정에서도 전문 재활 시설과 숙련된 치료사를 통해 환자의 일상 복귀를 돕습니다.뇌졸중 회복기에는 근육 경직과 관절 가동성 감소가 발생하며, 이를 완화하기 위해 이완 치료와 도수 치료가 필요합니다. 도수 치료는 전문의의 정확한 진단을 바탕으로 시행되며, 통증 경감, 균형 회복, 재발 방지에 효과적입니다.운동 치료는 근력과 협응을 회복하고, 반복적 재활 운동을 통해 신경 가소성 활성화를 촉진합니다. 보행 훈련과 균형 운동은 이동성과 심혈관 건강을 향상시키며, 낙상 위험을 줄이는 데도 기여합니다. 이완·교정·운동 치료는 잘못된 자세를 바로잡고, 통증 완화 효과를 장기간 유지하도록 돕는 중요한 역할을 합니다."],clinics:["자세교정치료와 맞춤형 운동치료의 이상적인 조합으로 환자의 빠른 치료와 재발방지","도수치료는 근육 경직 완화와 통증 경감을, 꾸준한 이완치료로 운동능력 회복","교정·운동·이완 치료는 균형과 이동성을 증진시키고, 삶의 질을 향상"]}],rO=Pe.div`
